import styled from "styled-components";

const DayBox = styled.li`
  list-style: none;
  width: 100%;
  height: 100%;
  border: 1px solid var(--line-gray);
  padding: 1rem;

  &:hover {
    background: var(--whiteblue);
  }
`;

const TodayBox = styled(DayBox)`{
  color: blue;
  span{
    color: blue;
  }
}



`;

export default function Day(props: { day: number; today: number }) {
  console.log(props);
  return props.day !== 0 ? (
    props.today !== props.day ? (
      <TodayBox>{props.day}</TodayBox>
    ) : (
      <DayBox>{props.day}</DayBox>
    )
  ) : (
    <DayBox></DayBox>
  );
}
